import React from 'react';
import Link from '@material-ui/core/Link';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Title from './Title';
import AddIcon from '@material-ui/icons/Add';
import Button from '@material-ui/core/Button';
import Grid from '@material-ui/core/Grid';
import Navigation from '../components/Navigation';

function createData(id, title, category, level, duration, price, subscriptions, status) {
  return { id, title, category, level, duration, price, subscriptions, status };
}

const rows = [
  createData(0, 'AWS Fundamentals', 'Information Technology', 'Beginner', 120, 200, 14, 'Active'),
  createData(1, 'Brand Management', 'Marketting', 'Expert', 60, 300, 7, 'Active'),
  createData(2, 'Weight Management', 'Nutrition', 'Beginner', 90, 240, 11, 'InActive'),
  createData(3, 'The Unix Workbench', 'Computer Science', 'Intermediate', 45, 150, 3, 'Active'),
  createData(4, 'Quantitative Modeling', 'Finance', 'Beginner', 75, 340, 19, 'InActive'),
  createData(5, 'Data Visualization', 'Data Science', 'Expert', 120, 450, 20, 'Active'),
];

function preventDefault(event) {
  event.preventDefault();
}

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  dataTable: {
    marginTop: theme.spacing(3),
  },
}));

export default function Devices() {
  const classes = useStyles();
  return (
    <React.Fragment>
      
      <div className={classes.root}>
        <Grid container spacing={2}>
          <Grid container xs={12} sm={6} justify="flex-start">
            <Title>Device List</Title>
          </Grid>          
          <Grid container xs={12} className={classes.dataTable}>
            <Table size="small">
              <TableHead>
                <TableRow>
                  <TableCell>Title</TableCell>
                  <TableCell>Category</TableCell>
                  <TableCell>Level</TableCell>
                  <TableCell>Duration</TableCell>
                  <TableCell>Price</TableCell>
                  <TableCell>Subscriptions</TableCell>
                  <TableCell>Status</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {rows.map((row) => (
                  <TableRow key={row.id}>
                    <TableCell>{row.title}</TableCell>
                    <TableCell>{row.category}</TableCell>
                    <TableCell>{row.level}</TableCell>
                    <TableCell>{row.duration}</TableCell>
                    <TableCell>{row.price}</TableCell>
                    <TableCell>{row.subscriptions}</TableCell>
                    <TableCell>{row.status}</TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </Grid>

          <Grid container xs={12} sm={6} spacing={2} justify="flex-end">
            <Button variant="contained"
              size="medium"
              color="primary"
              className={classes.button}
              startIcon={<AddIcon />}>
                Add
            </Button>
            <Button variant="contained"
              size="medium"
              color="primary"
              className={classes.button}
              startIcon={<AddIcon />}>
                Add
            </Button>
            <Button variant="contained"
              size="medium"
              color="primary"
              className={classes.button}
              startIcon={<AddIcon />}>
                Add
            </Button>
          </Grid>

        </Grid>
      </div>
    </React.Fragment>
  );
}
